@import url('https://fonts.googleapis.com/css?family=Roboto+Mono');

body {
	text-align: center;
	margin: 0;
	font-family: 'Roboto Mono', Arial, sans-serif;
	font-size: 20px;
	padding: 5vh 5vw;
	background-color: rgb(200,194,204);
	color: rgb(56, 54, 55);
}

img {
	margin: 0 auto;
	width: 75vw;
}

.project {
	width: 75vw;
	display: inline-block;
	vertical-align: top;
}

.title-fade-out {
	opacity: 0;
	animation-name: fade-out;
	animation-duration: 2s;
}

.title-fade-in {
	opacity: 1;
	animation-name: fade-in;
	animation-duration: 2s;
}

@keyframes fade-out {
	from { opacity: 1 }
	to { opacity: 0 }
}

@keyframes fade-in {
	from { opacity: 0 }
	to { opacity: 1 }
}

.dark {
	background-color: rgb(56, 54, 55);
	color: rgb(200,194,204);
}

#mode {
	position: sticky;
	display: block;
	top: 2vh;
	margin-left: 0;
	width: 55px;
	background-color: rgba(200,194,204, 0.8);
	color: rgb(56,54,55);
	font-family: inherit;
	padding: 10px;
	border-color: rgb(56,54,55);
}

#mode:hover {
	cursor: pointer;
}

#selfie {
	min-height: 300px;
	max-height: 40vh;
	max-width: 90vw;
	height:  auto;
	width: auto;
	border-radius: 220px;
}
